            WriteLiteral(@"page__description-text"" style=""height: 150px;"">
                        <p style=""font-family: 'Fira Sans', sans-serif; font-size: 18px; position: relative; color: black; text-align: left;"">
                            Инвестировать деньги разумно можно совершенно по-разному. Мы считаем, что вкладывать средства в вечный, неисчерпаемый ресурс Солнца не только разумно, но и выгодно. Солнечные электростанции (СЭС) — это трендовый продукт на рынке возобновляемой энергии последние пару десятков лет. Почему? Дело в том, что СЭС можно установить, как для личного использования в доме или на предприятии, так и для заработка на продаже электричества государству.
                        </p>
                        <h1 style=""font-family: 'Balsamiq Sans', cursive;font-size: 30px;position: relative;color: black; text-align: left;"">Как устроена СЭС, принцип работы и особенности строения</h1>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-a");
            WriteLiteral(@"lign: left;"">
                            Солнечная электростанция состоит из солнечных панелей, инвертора, коммутации и крепления.
                        </p>
                        <ul>
                            <li style=""font-family: 'Fira Sans', sans-serif; font-size: 18px; position: relative; color: black; text-align: left; text-align: justify; "">Солнечные панели — это внешняя часть электростанции, они поглощают солнечный свет.</li>
                            <li style=""font-family: 'Fira Sans', sans-serif; font-size: 18px; position: relative; color: black; text-align: left; text-align: justify; "">Инвертор отвечает за работу СЭС, он превращает постоянный ток в переменный, такой как в розетке.</li>
                            <li style=""font-family: 'Fira Sans', sans-serif; font-size: 18px; position: relative; color: black; text-align: left; text-align: justify; "">Коммутация — это система защиты СЭС (предохранители, автоматические выключатели, ограничители перенапряжения, двунаправленный счетч");
            WriteLiteral(@"ик).</li>
                            <li style=""font-family: 'Fira Sans', sans-serif; font-size: 18px; position: relative; color: black; text-align: left; text-align: justify; "">Солнечные панели — это внешняя часть электростанции, они поглощают солнечный свет.</li>
                        </ul>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            Каждая солнечная батарея состоит из фотоэлектрических преобразователей, у них энергия солнца преобразуется в электрическую. Чаще всего такие фотоэлементы изготавливают из кремния, полупроводника. Сам фотообразователь можно сравнить с сэндвичем, ведь он состоит из двух пластин. Одна пластина имеет избыток электронов, а вторая имеет свободные места, «дырки» для электронов. Между этими двумя пластинами расположилась зона, которая не допускает перехода избыточных электронов в тот слой, где их не хватает.
                        </p>
                 ");
            WriteLiteral(@"       <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            Итак, запускаем процесс генерирования электроэнергии:
                        </p>
                        <p style=""left:15px; font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            1. Фотон света влетает в два слоя и передает энергию солнца электронам;
                        </p>
                        <p style=""left:15px; font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            2. Электроны движутся по кругу в слоях в одном направлении, образуя постоянный ток;
                        </p>
                        <p style=""left:15px; font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            3. Инвертор преобразует пост");
            WriteLiteral(@"оянный ток в переменный.
                        </p>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            Фотоэлементы панелей разных брендов могут отличаться размером и формами. Производительность панели зависит от общего количества ячеек, а мощность одной ячейки составляет около 0,5 вольт.
                        </p>
                        <h1 style=""font-family: 'Balsamiq Sans', cursive;font-size: 30px;position: relative;color: black; text-align: left;"">Куда установить СЭС</h1>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            Солнечную электростанцию можно установить на крышу или открытый участок земли. Важно понимать, что для высокой продуктивности вашей СЭС необходимо открытое пространство и свободное поступление солнечного света. Получается, панели не должны быт");
            WriteLiteral(@"ь закрыты деревьями, кустами или другими предметами.
                        </p>

                        <h1 style=""font-family: 'Balsamiq Sans', cursive;font-size: 30px;position: relative;color: black; text-align: left;"">Как выбрать солнечные панели</h1>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            Четыре фактора, на которые стоит обратить внимание при выборе солнечных панелей.
                        </p>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            <b>Гарантия.</b> Не стоит рассматривать панели от производителей, которые дают гарантию всего на пару лет или не дают ее вовсе. Гарантия будет необходима в тот момент, если возникает гарантийная поломка. Например, в SUNSAY Energy оперативно и самостоятельно решает вопрос напрямую с поставщиком.
             ");
            WriteLiteral(@"           </p>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            <b>КПД.</b> Это значение указывает на то, сколько солнечной энергии, которая попадает на панели, будет преобразовано в электрический ток внутри модуля. Разница в КПД поликристаллических и монокристаллических моделей небольшая. В случае, если место для установки СЭС ограничено, стоит обратить внимание на то, что с помощью панелей с высоким КПД можно сократить площадь, которая нужна для установки.
                        </p>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            <b>Допустимая погрешность номинальной мощности.</b> Обратите внимание на этот параметр, так как от него зависит насколько настоящая мощность может отличаться от мощности, указанной в документах. Опять-таки, панели категории Tier 1, показ");
            WriteLiteral(@"ывают минимальную погрешность от данных в техническом паспорте.
                        </p>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            <b>Температурный коэффициент.</b> Этот показатель указывает на то, как может снизиться генерируемая мощность при повышении температуры на один градус. У панелей хорошего качества температурный коэффициент составляет -0,4 % на 1°C.
                        </p>
                        <h1 style=""font-family: 'Balsamiq Sans', cursive;font-size: 30px;position: relative;color: black; text-align: left;"">Солнечные панели и погодные условия</h1>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            Что делать, если солнце зашло за тучу? А ничего. В пасмурную погоду или при рассеянном свете, солнечные панели работают, но производительность з");
            WriteLiteral(@"ависит от плотности облака. Свет Солнца всегда достигает поверхности нашей планеты, а значит, и установленной СЭС. Современные солнечные панели строят так, чтобы они генерировали как можно больше электроэнергии при любой погоде. Единственная помеха — ночь. У ночное время СЭС электричество не производит, так как света нет совсем.
                        </p>
                        <p style="" font-family: 'Fira Sans', sans-serif;font-size: 18px;position: relative;color: black; text-align: left;"">
                            Солнечные панели очень устойчивы к разным погодным факторам (дождь, снег, ветер) и любое нарушение производительности маловероятно. К тому же, климат на территории Украины не предусматривает экстремальные погодные условия, а значит, СЭС подвержены минимальной деградации.
                        </p>
                    </div>
                </div>
            </div>
        </section>
    </main>
